import React from 'react';

function Appointments({ appointments }) {
  return (
    <div>
      <h2>Appointments</h2>
      <ul>
        {Object.entries(appointments).map(([dateString, appointment], index) => (
          <li key={`appointment-${index}`}>
            {dateString}: {appointment}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Appointments;
